  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130674 includes physical
  and profile data collected during project S-J924-NRT1-14 in the Gulf of Mexico and
  South Pacific Ocean from 2014-10-28 to 2015-05-19. These data include CONDUCTIVITY,
  HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE.
  The instruments used to collect these data include CTD. These data were collected
  and submitted by the NOAA Office of Coast Survey in support of hydrographic multibeam
  surveys to meet NOAA charting requirements.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
